import styled from "styled-components";
import PlaceHolder from "../../images/place_holder.png";

const GridProjetos = styled.div`
    margin-left: 0; 
    display: flex;
    flex-wrap: wrap; 
    justify-content: space-between;
    width: 100%; 
    box-sizing: inherit;
`;

const BoxProjetos = styled.div`
    padding-top: 56.25%;
    background-position: center;
    background-repeat: no-repeat;
    border-radius: 7px;
    display: table; 
    width: 100%;

    height: 14.


`;

const LinkProjetos = styled.a`
    display: block;
    width: 100%;
    height: 100%;
    background-image: url(${PlaceHolder});
    background-size: cover;
    background-position: center;
`;

function Projetos() {
    return (
        <GridProjetos>
            <BoxProjetos>
                <LinkProjetos href="#"></LinkProjetos>
            </BoxProjetos>
        </GridProjetos>
    );
}

export default Projetos;
